import {
  BrowserRouter as Router,
  Route
} from "react-router-dom";

import NotesListPage from "./pages/NotesListPage";


function App() {
  return (
    <BrowserRouter> 
    <Routes>
    <div className="App">

    <Route path ="/" exact component={NotesListPage}></Route>
      <NotesListPage/>
    </div>
     </Routes>
     </BrowserRouter>
  );
}

export default App;
